import React from 'react';

function ArticleSection() {
  return (
    <section>
    	<h2 className = "section_header">Brainstorming</h2>
    	<p className = "section_text">This is the text that I am using Brainstorming and my big fat brain to do things</p>
    	<img className = "section_image" href="https://live.staticflickr.com/65535/49927187188_3f290463f3_b.jpg" width="1080" height="1080" alt="Dreamer Final"/>
    </section>
  );
}

export default ArticleSection;
